import React from 'react';

function SubmitFeedback() {
  return (
    <div>
      <h2>Submit Feedback</h2>
      <ul>
        <li>Rate Product</li>
        <li>Write Review</li>
      </ul>
    </div>
  );
}

export default SubmitFeedback;
